// import { BiLibrary } from 'react-icons/bi';
// import { AiFillPlusSquare } from 'react-icons/ai';
// import { BiHeartSquare } from 'react-icons/bi';


function SideNav() {
    return (
        <div className="side-nav">
            <div className="header-logo">
                <img src={Logo} alt='logo' />
            </div>
        </div>

    )
}

